import react from "react";

export default function Nav() {
  return (
    <nav className="main-navigation">
      <ul>
        <li>
          <a href="#home">Home</a>
        </li>
        <li>
          <a href="#posts">Posts</a>
        </li>
        <li>
          <a href="#contact">Contact</a>
        </li>
      </ul>
    </nav>
  );
}
